import React,{useState, useEffect} from 'react';
import { onAuthStateChenged } from "firebase/auth";
import { auth } from "./FirebaseConfig.js";

export const myPage =()=>{
    const[user, setUser]=useState('')

    useEffect(()=>{
        onAuthStateChenged(auth,(currentUser)=>{
            setUser(currentUser)
        })
    },[])

    return (
        <>
        <h1>マイページ</h1>
        <button>ログアウト</button>
        </>
    )
}
